import React, { useEffect, useMemo, useState } from "react";
import { Link } from "react-router-dom";
import api from "../../api/axios";
import "../../styles/AdminPages.css";

export default function HousesList() {
  const [houses, setHouses] = useState([]);
  const [err, setErr] = useState("");
  const [q, setQ] = useState("");

  useEffect(() => {
    api
      .get("/api/houses")
      .then((res) => setHouses(res.data))
      .catch(() => setErr("Failed to load houses."));
  }, []);

  const filtered = useMemo(() => {
    const query = q.trim().toLowerCase();
    if (!query) return houses;

    return houses.filter((h) => {
      const name = (h.name || "").toLowerCase();
      const address = (h.address || "").toLowerCase();
      const owner = (h.ownerName || h.userName || h.userEmail || "").toLowerCase();
      const city = (h.city || "").toLowerCase();
      return (
        name.includes(query) ||
        address.includes(query) ||
        owner.includes(query) ||
        city.includes(query)
      );
    });
  }, [houses, q]);

  return (
    <section className="admin-page">
      <div className="admin-page-header">
        <div>
          <h2 className="section-title">Houses</h2>
          <p className="admin-muted">Manage houses and their assigned monitors/users.</p>
        </div>

        <Link className="cta-button" to="/admin/houses/new">
          Create House
        </Link>
      </div>

      <div className="admin-toolbar">
        <input
          className="admin-input"
          value={q}
          onChange={(e) => setQ(e.target.value)}
          placeholder="Search by house name, address, owner, cityâ€¦"
        />
        <div className="admin-pill">{filtered.length} result(s)</div>
      </div>

      {err && <p className="form-error">{err}</p>}

      <div className="admin-table">
        <div className="admin-table-scroll">
          <table className="admin-table-table">
            <thead>
              <tr>
                <th>House</th>
                <th>Address</th>
                <th>City</th>
                <th>Owner</th>
                <th>Monitor</th>
                <th className="th-actions">Actions</th>
              </tr>
            </thead>

            <tbody>
              {filtered.map((h, idx) => (
                <tr key={h.id || h.houseId || idx}>
                  <td data-label="House">
                    <div className="cell-title">{h.name || `House #${h.id || h.houseId || idx + 1}`}</div>
                    <div className="cell-sub">{h.houseCode || h.reference || ""}</div>
                  </td>

                  <td data-label="Address">{h.address || "-"}</td>
                  <td data-label="City">{h.city || "-"}</td>
                  <td data-label="Owner">
                    {h.ownerName || h.userName || h.userEmail || "-"}
                  </td>
                  <td data-label="Monitor">
                    {h.monitorSerial || h.monitorId || h.monitorType || "-"}
                  </td>

                  <td data-label="Actions" className="td-actions">
                    <Link className="row-link" to={`/admin/houses/${h.id || h.houseId}`}>
                      View
                    </Link>
                    <Link className="row-link" to={`/admin/houses/${h.id || h.houseId}/edit`}>
                      Edit
                    </Link>
                    {/* <button className="danger-btn" onClick={() => handleDelete(h.id)}>Delete</button> */}
                  </td>
                </tr>
              ))}

              {filtered.length === 0 && !err && (
                <tr>
                  <td colSpan={6} className="empty-cell">
                    No houses found.
                  </td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      </div>
    </section>
  );
}
